def generate_primes(lower, upper):
    """"""
    sieve = [True] * (upper + 1)
    p = 2
    while p * p <= upper:
        if sieve[p] == True:
            for i in range(p * p, upper + 1, p):
                sieve[i] = False
        p += 1
    primes = []
    for p in range(max(2, lower), upper + 1):
        if sieve[p]:
            primes.append(p)
    return primes
